from typing import Optional
import operator

class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next
        
class Solution:
    # 超出时间限制，时间复杂度高
    def sortList(self, head: Optional[ListNode]) -> Optional[ListNode]:
        if head == None:
            return head 
        dummpHead = ListNode(-100001,head)
        pre = dummpHead
        cur = head

        while(cur.next):
            # 先确定元素
            if cur.next.val >= cur.val:
                cur = cur.next
            # 后确定位置
            if cur.next:
                while(pre.next.val < cur.next.val):
                    pre = pre.next
                node = cur.next
                cur.next = node.next
                node.next = pre.next
                pre.next = node
                pre = dummpHead
                    
        return dummpHead.next
    
    # 用字典存储链表节点，排序后再重新生成链表
    def sortList2(self, head: Optional[ListNode]) -> Optional[ListNode]:
        if head == None:
            return head 
        headmapping = {}
        cur = head
        
        while(cur):
            if cur.val not in headmapping.keys():
                headmapping[cur.val] = 1
            else:
                headmapping[cur.val] += 1
            cur = cur.next
        
        newHead = p = ListNode(-10001,None)
        headmapping = dict(sorted(headmapping.items(), key=operator.itemgetter(0)))  #按照key值升序
        for i in headmapping.keys():
            for j in range(0,headmapping[i]):
                node = ListNode(i)
                p.next = node
                p = p.next             
        return newHead.next

    # 链表排序常用的归并排序(首先找到链表中点(快慢指针)，然后对前后两个链表分开排序（递归），最后在合并)
    def sortList3(self, head: Optional[ListNode]) -> Optional[ListNode]:
        def softFunc(head : ListNode, tail: ListNode) -> ListNode:
            # 链表为空
            if not head:
                return head
            # 只剩一个节点
            if head.next == tail:   
                head.next = None
                return head
            # 用快慢指针遍历链表，使快指针到末尾时，慢指针指向链表中点
            slow = fast = head
            # 只要快指针还没有到达链表末尾，就一直移动
            while fast != tail:
                slow = slow.next
                fast = fast.next
                if fast != tail:
                    fast = fast.next
            mid = slow
            # 递归进行先排序后合并
            return merge(softFunc(head,mid),softFunc(mid,tail))
        
        # 两个有序链表的合并
        def merge(head1: ListNode, head2: ListNode) -> ListNode:
            dummyNode = ListNode(0)
            temp, temp1, temp2 = dummyNode, head1, head2
            
            while temp1 and temp2:
                if temp1.val <= temp2.val:
                    temp.next = temp1
                    temp1 = temp1.next
                else:
                    temp.next = temp2
                    temp2 = temp2.next
                temp = temp.next
            if temp1:
                temp.next = temp1
            elif temp2:
                temp.next = temp2
            return dummyNode.next
        return softFunc(head,None)
